eholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n@tag@addEmp\nFeature: adding employee in HRMS application\n  \n  Background:\n  \tWhen user enters valid admin username and password\n  \tAnd user clicks on login button\n  \tThen user is successfully logged in the application\n  \tWhen user clicks on PIM option\n  \tAnd user clicks on add employee button\n \n  @tag1@addEmp\n  Scenario: Adding one employee\n    When user enters firstname and lastname\n    And user clicks on save button\n    Then employee added successfully\n\n  @tag2@addEmp\n  Scenario: Adding one employee from feature file\n  \tWhen user enters \"adam\" and \"lovely\" and \"farwa\"\n  \tAnd user clicks on save button\n  \tThen employee added successfully\n  \t\n  \t@tag3@addEmp\n  \tScenario Outline: adding multiple employees using scenario outline\n  \tWhen user enters \"<firstName>\" and \"<middleName>\" and \"<lastName>\" in data driven format\n  \tAnd user clicks on save button\n  \tThen employee added successfuly \n\n    Examples: \n     |firstName|middleName|lastName|\n     |jean\t\t |\tjac\t\t\t|jean\t\t |\n\t\t |pastor\t | angela\t\t| baker\t |\n\t\t |john\t\t | adam \t  | smith  |\n\t\t \n\t\t @tag4@addEmp@smoke\n\t\t Scenario: adding multiple employees using excel file\n\t\t When user adds multiple employees using excel from \"addEmployeeData\" and verify it\n\t\t \n\t\t \n\t\t \n\t\t ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/danie/eclipse-workspace/CucumberSelenium/./src/test/resources/features/addEmployee.feature","feature":{"location":{"line":20,"column":1},"tags":[{"location":{"line":19,"column":1},"name":"@tag","id":"c8174b21-5040-43d4-8ca9-47b52e809088"},{"location":{"line":19,"column":5},"name":"@addEmp","id":"f94b614a-97a2-4623-a946-452e7cf031f1"}],"language":"en","keyword":"Feature","name":"adding employee in HRMS application","description":"","children":[{"background":{"location":{"line":22,"column":3},"keyword"
